// frontend/src/components/GraphCanvas.tsx
import React, { useCallback, useState, useRef } from 'react';
import ReactFlow, {
  ReactFlowProvider,
  addEdge,
  useNodesState,
  useEdgesState,
  Controls,
  Background,
  MiniMap,
  Node,
  Edge,
  Connection,
  ReactFlowInstance,
} from 'reactflow';
import 'reactflow/dist/style.css';
import { useDrop } from 'react-dnd';
import { Activity } from '../types';

const GraphCanvasInner: React.FC = () => {
  const reactFlowWrapper = useRef<HTMLDivElement>(null);
  const [nodes, setNodes, onNodesChange] = useNodesState<Node[]>([]);
  const [edges, setEdges, onEdgesChange] = useEdgesState<Edge[]>([]);
  const [reactFlowInstance, setReactFlowInstance] = useState<ReactFlowInstance | null>(null);
  const [nextNodeId, setNextNodeId] = useState(1);

  const onConnect = useCallback(
    (params: Connection) => {
      setEdges((eds) => addEdge(params, eds));
    },
    [setEdges]
  );

  const onInit = useCallback((instance: ReactFlowInstance) => {
    console.log('ReactFlow initialized');
    setReactFlowInstance(instance);
  }, []);

  const addNode = useCallback((activity: Activity, position: { x: number; y: number }) => {
    const newNode: Node = {
      id: `node-${nextNodeId}`,
      type: 'default',
      position: position,
      data: { 
        label: (
          <div>
            <strong>{activity.name}</strong>
            <div style={{ fontSize: '10px', marginTop: '4px' }}>
              {activity.duration} min
            </div>
          </div>
        )
      },
      style: {
        background: activity.color || '#4CAF50',
        color: 'white',
        border: '1px solid #222',
        width: 180,
        borderRadius: '5px',
      },
    };

    console.log('Adding node:', newNode);
    setNodes((nds) => [...nds, newNode]);
    setNextNodeId(nextNodeId + 1);
  }, [nextNodeId, setNodes]);

  const [{ isOver, canDrop }, drop] = useDrop(() => ({
    accept: 'activity',
    drop: (item: Activity, monitor) => {
      console.log('Item dropped:', item);
      const offset = monitor.getClientOffset();

      if (offset && reactFlowWrapper.current) {
        const bounds = reactFlowWrapper.current.getBoundingClientRect();

        // Calculate position relative to the canvas
        let position = {
          x: offset.x - bounds.left,
          y: offset.y - bounds.top,
        };

        // If we have a ReactFlow instance, convert to flow coordinates
        if (reactFlowInstance) {
          position = reactFlowInstance.project(position);
        }

        console.log('Calculated position:', position);
        addNode(item, position);
      }

      return { dropped: true };
    },
    collect: (monitor) => ({
      isOver: monitor.isOver(),
      canDrop: monitor.canDrop(),
    }),
  }), [reactFlowInstance, addNode]);

  // Combine refs
  const setRefs = useCallback(
    (node: HTMLDivElement | null) => {
      reactFlowWrapper.current = node;
      drop(node);
    },
    [drop]
  );

  return (
    <div className="graph-canvas" style={{ flex: 1, display: 'flex', flexDirection: 'column' }}>
      <h2>Orchestration Graph</h2>
      <div 
        ref={setRefs}
        style={{ 
          flex: 1,
          border: `2px ${isOver ? 'dashed' : 'solid'} ${canDrop ? '#4CAF50' : '#ccc'}`,
          backgroundColor: isOver ? '#f0fff4' : '#fff',
          transition: 'all 0.2s',
          borderRadius: '8px',
          position: 'relative',
        }}
      >
        {nodes.length === 0 && (
          <div style={{
            position: 'absolute',
            top: '50%',
            left: '50%',
            transform: 'translate(-50%, -50%)',
            color: '#9ca3af',
            fontSize: '14px',
            pointerEvents: 'none',
            zIndex: 1,
          }}>
            Drag activities here to build your orchestration graph
          </div>
        )}
        <ReactFlow
          nodes={nodes}
          edges={edges}
          onNodesChange={onNodesChange}
          onEdgesChange={onEdgesChange}
          onConnect={onConnect}
          onInit={onInit}
          fitView
          attributionPosition="bottom-left"
        >
          <Background />
          <Controls />
          <MiniMap />
        </ReactFlow>
      </div>
    </div>
  );
};

const GraphCanvas: React.FC = () => {
  return (
    <ReactFlowProvider>
      <GraphCanvasInner />
    </ReactFlowProvider>
  );
};

export default GraphCanvas;
